    "2013-03-14T19:30:18.093238",nt"name": "aspen-delineation-plumas-national-forest-ds374",nt"isopen":
    false,nt"url": null,nt"notes": "The database represents delineations of
    aspen stands associated with stand assessment data (PLUMAS_NF_PTS) collected in
    aspen stands in the Plumas National Forest, Beckwourth Ranger District (Plumas County);
    field surveys and assessments were conducted by trained USFS staff. This is the
    current completed data set for aspen distribution of land administered by this agency.
    Aspen stands were assessed and delineated using a protocol developed by the lead
    investigators at the Beckwourth Ranger District. Data captures location and vegetative
    characteristics of aspen stands. Associated with this polygon layer is a point layer
    (PLUMAS_NF_PTS) containing aspen stand assessments conducted in conjunction with
    the aspen stand delineations. Data Compilation: The Aspen Delineation Project (ADP)
    is a collaborative effort of the U.S. Forest Service's Pacific Southwest Region,
    the California Department of Fish and Games Resource Assessment Program, and the
    California Office of Bureau of Land Management. Principal Investigator for ADP is
    David Burton; visit: www.aspensite.org for more information regarding the ADP. The
    Department of Fish and Games, Resource Assessment Program compiled this information
    from the collaborating agencies and other researchers, and formatted the data into
    a common database for the purpose of facilitating access to data related to the
    conservation of Quaking Aspen in California. This information portal falls within
    the ADP goals to help agencies and land managers identify, map, treat, and monitor
    aspen habitats. This dataset is a portion of a master database compiled during a
    year long effort in 2005 to pull together current GIS layers and maps depicting
    Aspen communities in California.",nt"license_title": null,nt"extras": [{ntt"key":
